ï»¿<!DOCTYPE html>
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
    <title>Euro Buk Simulator 2014</title>
    <link rel="stylesheet" type="text/css" media="screen" href="simulator.css">
    <meta id="viewport" name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
    <meta name="apple-mobile-web-app-capable" content="yes">
    <meta name="apple-mobile-web-app-status-bar-style" content="black">
</head>

<body>
    <script type="text/javascript" src="js/lib/melon.js"></script>
    <script type="text/javascript" src="js/game.js"></script>
    <script type="text/javascript" src="js/resources.js"></script>
    <script type="text/javascript" src="js/entities.js"></script>
    <script type="text/javascript" src="js/screen.js"></script>
    <script type="text/javascript" src="js/debugPanel.js"></script>

    <!-- Canvas placeholder -->
    <div id="screen"></div>

    <script type="text/javascript">

        /* Bootstrap */
        window.onReady(function onReady() {
            game.onload();

            // Mobile browser hacks
            if (me.device.isMobile && !navigator.isCocoonJS) {
                // Prevent the webview from moving on a swipe
                window.document.addEventListener("touchmove", function (e) {
                    e.preventDefault();
                    window.scroll(0, 0);
                    return false;
                }, false);

                // Scroll away mobile GUI
                (function () {
                    window.scrollTo(0, 1);
                    me.video.onresize(null);
                }).defer();

                me.event.subscribe(me.event.WINDOW_ONRESIZE, function (e) {
                    window.scrollTo(0, 1);
                });
            }
        });
    </script>

</body>
</html>
